* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}

.header {
  width: 100%;
  padding: 10px 30px;
  background-color: #ee534f;
}

.header h5 {
  font-weight: bold;
  font-family: verdana;
  font-size: 28px;
  color: #fff;
}

/* upper btn box */
.upper-btn-box {
  width: 100%;
  height: 100px;
  display: flex;
  padding: 30px;
}

.upper-btn-box .left-box {
  width: 50%;
  height: 100%;
  

}

.upper-btn-box .right-box {
  width: 50%;
  height: 100%;
  background-color: rgb(47, 38, 171);
}
